description:
Category	Feature, Foreign

Starring	Tony Carrera, Phil Hollyday, Titof, Rick Angel, Petr, Romain, Pierre Des Essentes

Two young and gorgeous heiresses are invited to the French capital shortly after their father's death. They will quickly become objects of desire for a band of lecherous rascals As soon as they arrive, Roxy and Shana are greeted by Liza. Liza hurries to introduce them to two television producers, and, incapable of resisting these young men's 'French charm', the two sisters will soon give themselves to them, and succumb to their every wish and most perverse desires.


